INSERT INTO `service` VALUES ('1. Condizionalità a) azienda mista - A',14,10,'Il servizio di consulenza proposto è finalizzato all’individuazione, per ogni destinatario finale che ne usufruirà, degli obblighi derivanti dall’applicazione dei criteri di gestione obbligatori (CGO) e delle norme per il mantenimento del terreno in buone condizioni agronomiche e ambientali (BCAA) del regime di condizionalità di cui agli artt.93 e 94 e a norma dell\'Allegato II del Reg. UE n. 1306/2013 nonché per definire i requisiti minimi relativi all\'uso dei fertilizzanti e dei prodotti fitosanitari di cui agli articoli 28 e 29 del Reg UE n. 1305/2013.','1. Condizionalità  a) Obblighi aziendali derivanti da CGO e BCAA - A','a:4:{i:0;s:64:\"Check-up aziendale e programmazione della consulenza da svolgere\";i:1;s:268:\"Attività di consulenza per verificare il rispetto dei criteri di gestione obbligatori (CGO) e (BCAA) riconducibili al destinatario finale. L’attività si svolgerà mediante visite aziendali di 2 ore di consulenza ciascuna e saranno impiegate check list di controllo\";i:2;s:240:\"Attività di consulenza per la verifica dei criteri di gestione obbligatori (CGO) e (BCAA). L’attività si svolgerà mediante la verifica di check list di controllo e l’elaborazione della documentazione tecnica che si è resa necessaria\";i:3;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:2:{i:0;s:297:\"individuare gli obblighi aziendali per il destinatario finale relativamente al mantenimento del rispetto dei criteri di gestione obbligatori (CGO) e (BCAA), contestualmente rendere tali azioni compatibili con la realtà aziendale del destinatario finale oltreché essere economicamente sostenibili\";i:1;s:92:\"sensibilizzare il destinatario finale nei confronti delle più complesse norme da rispettare\";}','Mediante l’esperienza del consulente rappresentata dalla propria conoscenza tecnico/scientifica della materia di competenza, dall’utilizzo degli strumenti informatici ed anche dalla capacità di comunicare con l’interlocutore, sarà possibile far comprendere al destinatario finale gli obblighi aziendali nei confronti delle CGO e BCAA e i necessari interventi da apportare nella propria azienda per rispettare le normative.',NULL,NULL,2),('1. Condizionalità a) produzione vegetale - A',12,8,'Il servizio di consulenza proposto è finalizzato all’individuazione, per ogni destinatario finale che ne usufruirà, degli obblighi derivanti dall’applicazione dei criteri di gestione obbligatori (CGO) e delle norme per il mantenimento del terreno in buone condizioni agronomiche e ambientali (BCAA) del regime di condizionalità di cui agli artt.93 e 94 e a norma dell\'Allegato II del Reg. UE n. 1306/2013 nonché per definire i requisiti minimi relativi all\'uso dei fertilizzanti e dei prodotti fitosanitari di cui agli articoli 28 e 29 del Reg UE n. 1305/2013.','1. Condizionalità  a) Obblighi aziendali derivanti da CGO e BCAA - A','a:4:{i:0;s:64:\"Check-up aziendale e programmazione della consulenza da svolgere\";i:1;s:346:\"Attività di consulenza per la verifica dei criteri di gestione obbligatori (CGO) e delle norme per il mantenimento del terreno in buone condizioni agronomiche e ambientali (BCAA) riconducibili al destinatario finale. L’attività si svolgerà mediante visite aziendali di 2 ore di consulenza ciascuna e saranno impiegate check list di controllo\";i:2;s:366:\"Attività di consulenza per la verifica dei criteri di gestione obbligatori (CGO) e delle norme per il mantenimento del terreno in buone condizioni agronomiche e ambientali (BCAA) riconducibili al destinatario finale. L’attività si svolgerà mediante la verifica di check list di controllo e l’elaborazione della documentazione tecnica che si è resa necessaria\";i:3;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:2:{i:0;s:387:\"individuare gli obblighi aziendali per il destinatario finale relativamente al mantenimento del rispetto dei criteri di gestione obbligatori (CGO) e delle norme per il mantenimento del terreno in buone condizioni agronomiche e ambientali (BCAA) e contestualmente rendere tali azioni compatibili con la realtà aziendale del destinatario finale oltreché essere economicamente sostenibili\";i:1;s:92:\"sensibilizzare il destinatario finale nei confronti delle più complesse norme da rispettare\";}','Mediante l’esperienza del consulente rappresentata dalla propria conoscenza tecnico/scientifica della materia di competenza, dall’utilizzo degli strumenti informatici ed anche dalla capacità di comunicare con l’interlocutore, sarà possibile far comprendere al destinatario finale sia gli obblighi aziendali nei confronti delle CGO e BCAA, che i necessari interventi da apportare nella propria azienda per rispettare le normative.',NULL,NULL,2),('1. Condizionalità b) azienda mista - A',12,8,'Il servizio di consulenza proposto è finalizzato all’individuazione, per ogni destinatario finale che ne usufruirà, degli obblighi derivanti dall’applicazione delle nuove normative sulla condizionalità.','1. Condizionalità  b) Adeguamento nuove normative - A','a:4:{i:0;s:64:\"Check-up aziendale e programmazione della consulenza da svolgere\";i:1;s:250:\"Attività di consulenza per la verifica delle nuove normative sulla condizionalità riconducibili al destinatario finale. L’attività si svolgerà mediante visite aziendali di 2 ore di consulenza ciascuna e saranno impiegate check list di controllo\";i:2;s:270:\"Attività di consulenza per la verifica delle nuove normative sulla condizionalità riconducibili al destinatario finale. L’attività si svolgerà mediante la verifica di check list di controllo e l’elaborazione della documentazione tecnica che si è resa necessaria\";i:3;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:2:{i:0;s:275:\"individuare gli obblighi aziendali per il destinatario finale relativamente all’adeguamento alle nuove norme sulla condizionalità e contestualmente rendere tali azioni compatibili con la realtà aziendale del destinatario finale oltreché essere economicamente sostenibili\";i:1;s:92:\"sensibilizzare il destinatario finale nei confronti delle più complesse norme da rispettare\";}','Mediante l’esperienza del consulente rappresentata dalla propria conoscenza tecnico/scientifica della materia di competenza, dall’utilizzo degli strumenti informatici ed anche dalla capacità di comunicare con l’interlocutore, sarà possibile far comprendere al destinatario finale sia gli obblighi aziendali nei confronti delle nuove normative, che i relativi interventi da apportare nella propria azienda per adeguarsi.',NULL,NULL,2),('1. Condizionalità b) produzione vegetale - A',10,6,'Il servizio di consulenza proposto è finalizzato all’individuazione, per ogni destinatario finale che ne usufruirà, degli obblighi derivanti dall’applicazione delle nuove normative sulla condizionalità.','1. Condizionalità  a) Adeguamento nuove normative - A','a:4:{i:0;s:64:\"Check-up aziendale e programmazione della consulenza da svolgere\";i:1;s:250:\"Attività di consulenza per la verifica delle nuove normative sulla condizionalità riconducibili al destinatario finale. L’attività si svolgerà mediante visite aziendali di 2 ore di consulenza ciascuna e saranno impiegate check list di controllo\";i:2;s:270:\"Attività di consulenza per la verifica delle nuove normative sulla condizionalità riconducibili al destinatario finale. L’attività si svolgerà mediante la verifica di check list di controllo e l’elaborazione della documentazione tecnica che si è resa necessaria\";i:3;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:2:{i:0;s:275:\"individuare gli obblighi aziendali per il destinatario finale relativamente all’adeguamento alle nuove norme sulla condizionalità e contestualmente rendere tali azioni compatibili con la realtà aziendale del destinatario finale oltreché essere economicamente sostenibili\";i:1;s:92:\"sensibilizzare il destinatario finale nei confronti delle più complesse norme da rispettare\";}','Mediante l’esperienza del consulente rappresentata dalla propria conoscenza tecnico/scientifica della materia di competenza, dall’utilizzo degli strumenti informatici ed anche dalla capacità di comunicare con l’interlocutore, sarà possibile far comprendere al destinatario finale sia gli obblighi aziendali nei confronti delle nuove normative, che i relativi interventi da apportare nella propria azienda per adeguarsi.',NULL,NULL,2),('10. Opportunità del PSR 2014-2020 a) A',12,8,'Il servizio di consulenza proposto è finalizzato all’individuazione, per ogni destinatario finale che ne usufruirà, degli elementi normativi ed opportunità offerte dal PSR 2014-2020, ivi compresa la predisposizione della domanda grafica e l’assistenza nelle fasi successive all’ammissione al finanziamento ed il rispetto degli impegni assunti.','10. Elementi normativi ed opportunità del PSR 2014-2020 a) Predisposizione della domanda grafica, fasi successive all’ammissione al finanziamento compreso il rispetto degli impegni assunti - A','a:4:{i:0;s:183:\"Check-up aziendale e programmazione della consulenza per le opportunità offerte dal PSR 2014 – 2020 e la rilevazione dei dati necessari per la predisposizione della domanda grafica\";i:1;s:111:\"Attività di consulenza per predisposizione della domanda grafica e le opportunità offerte dal PSR 2014 - 2020\";i:2;s:211:\"Attività di consulenza per l’assistenza nelle fasi successive all’ammissione al finanziamento ed il rispetto degli impegni assunti. L’attività si svolgerà mediante la verifica di check list di controllo\";i:3;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:2:{i:0;s:108:\"individuare le effettive esigenze aziendali in compatibilità con le opportunità previste dal PSR 2014/2020\";i:1;s:75:\"sensibilizzare il destinatario finale per il rispetto degli impegni assunti\";}','Mediante l’esperienza del consulente rappresentata dalla propria conoscenza tecnico/scientifica della materia di competenza, dall’utilizzo degli strumenti informatici ed anche dalla capacità di comunicare con l’interlocutore, sarà possibile accedere alle opportunità previste dal PSR 2014/2020 per rendere maggiormente competitiva l’azienda del destinatario finale.',NULL,NULL,NULL),('11. Innovazione tecnologica e informatica a) A',14,11,'Il servizio di consulenza proposto è finalizzato all’individuazione, per ogni destinatario finale che ne usufruirà, delle tecniche e delle tecnologie propedeutiche all’implementazione di una strategia gestionale di un’agricoltura che si avvale di moderne strumentazioni per eseguire gli interventi agronomici tenendo conto dell’effettiva esigenze colturali e delle caratteristiche biochimiche e fisiche del suolo.','1. Innovazione tecnologica e informatica, agricoltura di precisione a) Agricoltura di precisione: analisi delle prassi migliorative nei cicli produttivi agricoli e tecnologie abilitanti - A','a:4:{i:0;s:64:\"Check-up aziendale e programmazione della consulenza da svolgere\";i:1;s:448:\"Attività di analisi dei processi colturali adottati dal destinatario finale e identificazione dei fattori critici sui quali intervenire mediante immediato adeguamento o successiva introduzione di dotazioni tecnologiche. L’attività si svolgerà mediante visite aziendali di 2 ore di consulenza ciascuna e saranno impiegate check list di controllo. In questa fase l’attività di back office, in termini di tempo necessario, sarà poco rilevante\";i:2;s:145:\"Identificazione e assistenza all’implementazione delle prassi migliorative nei cicli produttivi agricoli e delle relative tecnologie abilitanti\";i:3;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:1:{i:0;s:135:\"sensibilizzare il destinatario finale verso gli orizzonti messi a disposizione dalle soluzioni innovative, tecnologiche ed informatiche\";}','Mediante l’esperienza del consulente rappresentata dalla propria conoscenza tecnico/scientifica della materia di competenza, dall’utilizzo degli strumenti informatici ed anche dalla capacità di comunicare con l’interlocutore, sarà possibile far comprendere al destinatario finale i vantaggi derivati dall’implementazione delle nuove ed innovative prassi di coltivazione.',NULL,NULL,2),('11. Innovazione tecnologica e informatica b) B',34,19,'Il servizio di consulenza proposto è finalizzato all’individuazione, per ogni destinatario finale che ne usufruirà, delle opportunità derivanti dalla digitalizzazione di determinati processi produttivi e all’implementazione dei processi necessari al raggiungimento degli obbiettivi prefissati.','1. Innovazione tecnologica e informatica, agricoltura di precisione b) B – Introduzione delle tecnologie abilitanti nelle specifiche fasi dei processi produttivi agricoli e digitalizzazione','a:5:{i:0;s:64:\"Check-up aziendale e programmazione della consulenza da svolgere\";i:1;s:395:\"Attività di analisi dei processi produttivi e gestionali, delle modalità di commercializzazione dei prodotti, delle tecniche di marketing e la brand identity online. L’attività si svolgerà mediante visite aziendali di 3 ore di consulenza ciascuna e saranno impiegate check list di controllo. In questa fase l’attività di back office, in termini di tempo necessario, sarà poco rilevante\";i:2;s:168:\"Attività di implementazione dei processi innovativi e di digitalizzazione mediante confronto con il destinatario finale e mediante un impegnativo lavoro di back office\";i:3;s:119:\"Attività di misurazione del risultato ottenuto mediante l’applicazione dei processi innovativi e di digitalizzazione\";i:4;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:2:{i:0;s:259:\"individuare nei processi produttivi per il destinatario finale, gli interventi innovativi da inserire per l’ottenimento di un significativo miglioramento produttivo per la realtà aziendale del destinatario finale oltreché essere economicamente sostenibili\";i:1;s:123:\"sensibilizzare il destinatario finale verso gli orizzonti messi a disposizione dalle soluzioni tecnologiche ed informatiche\";}','Mediante l’esperienza del consulente rappresentata dalla propria conoscenza tecnico/scientifica della materia di competenza, dall’utilizzo degli strumenti informatici ed anche dalla capacità di comunicare con l’interlocutore, sarà possibile far comprendere al destinatario finale i vantaggi derivati dagli investimenti nel settore tecnologico e dalla digitalizzazione aziendale.',NULL,NULL,3),('12. Silvicoltura a) A',14,8,'Il servizio di consulenza proposto è finalizzato all’individuazione, per ogni destinatario finale che ne usufruirà, degli obblighi derivanti dall’applicazione della normativa comunitaria DUE DILIGENCE (la dovuta diligenza) l’operatore deve tenere traccia accurata dei propri obblighi e di qualsiasi evidenza pratica disponibile della propria osservanza di tali obblighi (come il pagamento di imposte, etc.). Un’azienda che utilizza boschi in piedi potrebbe dover chiedere al gestore forestale una parte di tale documentazione.\nInoltre il servizio proposto è finalizzato ad adempiere ad alcune norme ed adempimenti periodici della legge forestale della Toscana quali:\n- la richiesta e la modifica dei tesserini forestali per i titolari e per gli operai delle imprese boschive;\n- la richiesta ed il rinnovo delle iscrizioni agli elenchi delle ditte boschive della Toscana;\n- la comunicazione obbligatoria inerente le superfici utilizzate ed il legname prodotto nella stagione silvana precedente;\n- la predisposizione e l’invio delle dichiarazioni di taglio boschivo;','12. Silvicoltura  a) Obblighi derivanti dalla normativa comunitaria, adeguamento nuove normative forestale nazionale e regionale , “Due Diligence” e sicurezza sul lavoro in ambito forestale - A','a:4:{i:0;s:64:\"Check-up aziendale e programmazione della consulenza da svolgere\";i:1;s:336:\"Attività di consulenza per Sistema di dovuta diligenza (Due Diligence System - DDS)  richiesto dal Regolamento Legno dell’UE (European Union Timber Regulation - EUTR) riconducibili al destinatario finale. L’attività si svolgerà mediante visite aziendali di 2 ore di consulenza ciascuna e saranno impiegate check list di controllo\";i:2;s:353:\"Attività di consulenza per adempimenti periodici della Legge Forestale della Toscana, riconducibili al destinatario finale. L’attività si svolgerà mediante visite aziendali di 2 ore e attività di consulenza di 2 ore ciascuna, mediante la verifica di check list di controllo e l’elaborazione della documentazione tecnica che si è resa necessaria\";i:3;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:2:{i:0;s:316:\"individuare gli obblighi aziendali per il destinatario finale relativamente al rispetto dei criteri della DUE Diligence e delle norme del Regolamento forestale della Toscana e contestualmente rendere tali azioni compatibili con la realtà aziendale del destinatario finale oltreché essere economicamente sostenibili\";i:1;s:92:\"sensibilizzare il destinatario finale nei confronti delle più complesse norme da rispettare\";}','Mediante l’esperienza del consulente rappresentata dalla propria conoscenza tecnico/scientifica della materia di competenza, dall’utilizzo degli strumenti informatici ed anche dalla capacità di comunicare con l’interlocutore, sarà possibile far comprendere al destinatario finale sia gli obblighi aziendali nei confronti della DUE Diligence E DEL REGOLAMENTO FORESTALE DELLA Toscana e dei necessari interventi da apportare nella propria azienda per rispettare le normative.',NULL,NULL,2),('12. Silvicoltura b) B',34,20,'Il servizio di consulenza proposto è finalizzato all’individuazione, per ogni destinatario finale che ne usufruirà, sia degli obblighi derivanti dalla legge forestale della Toscana per quanto riguarda la pianificazione dei tagli forestali, sia delle opportunità legate ad alcuni bandi del PSR Regionale e del GAL Appennino Aretino in particolare per la partecipazione alla misura 8.6 “Sostegno ad investimenti nelle tecnologie silvicole”. Infine la consulenza potrà vertere sugli adempimenti legati all’appartenenza alle filiere legno-energia.','12. Silvicoltura  b) Miglioramento economico ambientale: gestione forestale sostenibile e clima, pianificazione aziendale, innovazioni tecniche, opportunità derivanti dal PSR, energia da fonti rinnovabili e fruizione turistico/ricreativa e sociale - B','a:4:{i:0;s:64:\"Check-up aziendale e programmazione della consulenza da svolgere\";i:1;s:287:\"Attività di consulenza nella Pianificazione dei tagli ai sensi dell’art. 44 del regolamento forestale DPGR 48/R/2003, riconducibili al destinatario finale. L’attività si svolgerà mediante visite aziendali di 8 ore di consulenza ciascuna e saranno impiegate check list di controllo\";i:2;s:386:\"Attività di consulenza per la partecipazione alla sottomisura 8.6 “Sostegno a investimenti in tecnologie silvicole, trasformazione, mobilitazione, commercializzazione dei prodotti delle foreste”.riconducibili al destinatario finale. L’attività si svolgerà mediante la verifica di check list di controllo e l’elaborazione della documentazione tecnica che si è resa necessaria\";i:3;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:3:{i:0;s:172:\"individuare gli obblighi aziendali per il destinatario finale relativamente alla pianificazione, obbligatoria o volontaria, dei tagli boschivi ed agli adempimenti correlati\";i:1;s:147:\"individuare le possibilità e predisporre le domande di contributo per la partecipazione a bandi regionali o bandi Leader nel settore legno-foresta\";i:2;s:126:\"sensibilizzare il destinatario finale nei confronti delle più complesse norme da rispettare e delle opportunità da sfruttare\";}','Mediante l’esperienza del consulente rappresentata dalla propria conoscenza tecnico/scientifica della materia di competenza, dall’utilizzo degli strumenti informatici ed anche dalla capacità di comunicare con l’interlocutore, sarà possibile far comprendere al destinatario finale sia gli obblighi aziendali nei confronti delle norme forestali, sia i necessari interventi ed adempimenti da realizzare nella propria azienda per rispettare le normative e per accrescere la competitività utilizzando le risorse dei bandi PSR o Leader.',NULL,NULL,8),('2. Pratiche benefiche per ambiente e clima a) A',14,8,'Il servizio di consulenza proposto è finalizzato all’individuazione, per ogni destinatario finale che ne usufruirà, delle soluzioni ottimali, applicate alla propria realtà aziendale, per fronteggiare il fenomeno dei cambiamenti climatici.','2. Pratiche benefiche per l\'ambiente e clima a) Verifica e adattamento dei sistemi colturali ai cambiamenti climatici - A','a:4:{i:0;s:64:\"Check-up aziendale e programmazione della consulenza da svolgere\";i:1;s:372:\"Attività di consulenza per la verifica e dell’applicazione delle idonee misure, riconducibili al destinatario finale, che possano fronteggiare il fenomeno dei cambiamenti climatici e che allo stesso tempo essere sostenibili per l’azienda. L’attività si svolgerà mediante visite aziendali di 2 ore di consulenza ciascuna e saranno impiegate check list di controllo\";i:2;s:409:\"Attività di consulenza per la verifica e dell’applicazione delle idonee misure, riconducibili al destinatario finale, che possano fronteggiare il fenomeno dei cambiamenti climatici e che allo stesso tempo essere sostenibili per l’azienda. L’attività si svolgerà mediante la verifica di check list di controllo e l’elaborazione, in back office, della documentazione tecnica che si è resa necessaria\";i:3;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:2:{i:0;s:105:\"approfondita analisi degli elementi intrinseci che contraddistinguono l’azienda del destinatario finale\";i:1;s:90:\"sensibilizzare il destinatario finale nei confronti del fenomeno dei cambiamenti climatici\";}','Mediante l’esperienza del consulente rappresentata dalla propria conoscenza tecnico/scientifica della materia di competenza, dall’utilizzo degli strumenti informatici ed anche dalla capacità di comunicare con l’interlocutore, sarà possibile far comprendere al destinatario finale l’importanza del proprio ruolo circa le problematiche da affrontare.',NULL,NULL,2),('2. Pratiche benefiche per ambiente e clima b) B',33,22,'l servizio di consulenza proposto è finalizzato all’individuazione, per ogni destinatario finale che ne usufruirà, delle soluzioni ottimali per la conservazione del suolo e dei sistemi colturali conservativi.','2. Pratiche benefiche per l\'ambiente e clima b) Conservazione del suolo e sistemi colturali conservativi - B','a:4:{i:0;s:64:\"Check-up aziendale e programmazione della consulenza da svolgere\";i:1;s:321:\"Attività di consulenza sulle misure da adottare per la conservazione del suolo e dell’ambiente agrario nell’ambito della tipologia e localizzazione dell’azienda del destinatario finale. L’attività si svolgerà mediante visite aziendali di 2 ore di consulenza ciascuna e saranno impiegate check list di controllo\";i:2;s:275:\"Implementazione della documentazione tecnica e degli interventi di monitoraggio correlati alle misure preventive implementate. L’attività si svolgerà mediante la verifica di check list di controllo e l’elaborazione della documentazione tecnica che si è resa necessaria\";i:3;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:2:{i:0;s:123:\"individuare per il destinatario finale, le misure più appropriate per la conservazione del suolo e dell’ambiente agrario\";i:1;s:97:\"sensibilizzare il destinatario finale nei confronti delle pratiche benefiche per ambiente e clima\";}','Mediante l’esperienza del consulente rappresentata dalla propria conoscenza tecnico/scientifica della materia di competenza, dall’utilizzo degli strumenti informatici ed anche dalla capacità di comunicare con l’interlocutore, sarà possibile far comprendere al destinatario finale l’importanza del proprio ruolo circa le problematiche da affrontare.',NULL,NULL,2),('2. Pratiche benefiche per ambiente e clima c) A',14,8,'Il servizio di consulenza proposto è finalizzato all’individuazione, per ogni destinatario finale che ne usufruirà, dei sistemi colturali e di gestione degli allevamenti ammessi in agricoltura biologica.','2. Pratiche benefiche per l\'ambiente e clima c) Agricoltura e allevamento biologico - A','a:4:{i:0;s:64:\"Check-up aziendale e programmazione della consulenza da svolgere\";i:1;s:311:\"Attività di consulenza per la verifica e dell’applicazione delle idonee misure, riconducibili al destinatario finale, compatibili al Reg. CE 834/2007 ed alla normativa in materia. L’attività si svolgerà mediante visite aziendali di 2 ore di consulenza ciascuna e saranno impiegate check list di controllo\";i:2;s:225:\"Attività di monitoraggio e verifica delle misure adottate. L’attività si svolgerà mediante la verifica di check list di controllo e l’elaborazione, in back office, della documentazione tecnica che si è resa necessaria\";i:3;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:2:{i:0;s:102:\"approfondita analisi degli elementi intrinseci che contraddistinguono ogni singolo destinatario finale\";i:1;s:89:\"sensibilizzare il destinatario finale nei confronti dell’appropriata prassi di gestione\";}','Mediante l’esperienza del consulente rappresentata dalla propria conoscenza tecnico/scientifica della materia di competenza, dall’utilizzo degli strumenti informatici ed anche dalla capacità di comunicare con l’interlocutore, sarà possibile rispettare correttamente il sistema colturale e di gestione preventivamente definito.',NULL,NULL,2),('3. Investimenti e competitività a) B',34,22,'Il servizio di consulenza proposto è finalizzato all’individuazione, per ogni destinatario finale che ne usufruirà, delle metodologie per la valorizzazione delle produzioni agricole di qualità ed i percorsi di promozione e marketing più affini alle proprie esigenze aziendali.','3. Investimenti e competitività  a) Tecniche di marketing e internazionalizzazione delle imprese; promozione e valorizzazione delle produzioni agricole di qualità - A','a:5:{i:0;s:64:\"Check-up aziendale e programmazione della consulenza da svolgere\";i:1;s:334:\"Attività di consulenza per l’individuazione delle possibili metodologie per la valorizzazione delle produzioni agricole di qualità ed i percorsi di promozione e marketing affini al destinatario finale. L’attività si svolgerà mediante visite aziendali di 2 ore di consulenza ciascuna e saranno impiegate check list di controllo\";i:2;s:156:\"Attività di implementazione della documentazione e dei processi aziendali mediante confronto con il destinatario finale e mediante attività in back office\";i:3;s:104:\"Attività di misurazione del risultato ottenuto mediante l’applicazione delle misure/processi attivati\";i:4;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:3:{i:0;s:214:\"individuare nei processi produttivi per il destinatario finale, gli interventi innovativi da inserire per l’ottenimento di una significativa valorizzazione del prodotto mediante percorsi di promozione e marketing\";i:1;s:122:\"il percorso da implementare dovrà essere condiviso con il destinatario finale oltreché essere economicamente sostenibili\";i:2;s:123:\"sensibilizzare il destinatario finale verso gli orizzonti messi a disposizione dalle soluzioni tecnologiche ed informatiche\";}','Mediante l’esperienza del consulente rappresentata dalla propria conoscenza tecnico/scientifica della materia di competenza, dall’utilizzo degli strumenti informatici ed anche dalla capacità di comunicare con l’interlocutore, sarà possibile far comprendere al destinatario finale i vantaggi derivati da una corretta valorizzazione dei prodotti agricoli di qualità.',NULL,NULL,2),('3. Investimenti e competitività b) A',14,10,'Il servizio di consulenza proposto è finalizzato all’individuazione, per ogni destinatario finale che ne usufruirà, dei processi finalizzati allo sviluppo delle filiere corte ed affini alle proprie esigenze aziendali.','3. Investimenti e competitività  b) Supporto e sviluppo delle filiere corte - A','a:3:{i:0;s:64:\"Check-up aziendale e programmazione della consulenza da svolgere\";i:1;s:283:\"Attività di consulenza per l’individuazione delle possibili metodologie di valorizzazione e sviluppo delle filiere corte affini al destinatario finale. L’attività si svolgerà mediante visite aziendali di 2 ore di consulenza ciascuna e saranno impiegate check list di controllo\";i:2;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:2:{i:0;s:191:\"individuare le effettive esigenze per il destinatario finale a volte può essere complicato soprattutto per i produttori di specie vegetali annuali che le stesse variano ogni campagna agraria\";i:1;s:82:\"sensibilizzare il destinatario finale verso la politica di aggregazione in filiere\";}','Mediante l’esperienza del consulente rappresentata dalla propria conoscenza tecnico/scientifica della materia di competenza, dall’utilizzo degli strumenti informatici ed anche dalla capacità di comunicare con l’interlocutore, sarà possibile far comprendere al destinatario finale i vantaggi derivati dallo sviluppo di filiere corte.',NULL,NULL,2),('3. Investimenti e competitività c) B',34,22,'Il servizio di consulenza proposto, di ampio ambito per ogni destinatario finale che ne usufruirà, si prefigge di individuare le maggiori criticità aziendali inerenti la gestione amministrativa, finanziaria e di gestione del personale.','3. Investimenti e competitività  c) Management aziendale: gestione amministrativa e finanziaria, accesso al credito, problematiche gestionali con particolare riferimento alla intermediazione illecita ed allo sfruttamento del lavoro - B','a:4:{i:0;s:64:\"Check-up aziendale e programmazione della consulenza da svolgere\";i:1;s:413:\"Attività di consulenza per verificare l’organizzazione e la gestione amministrativa e finanziaria evidenziando le criticità su cui prevedere le azioni correttive.\nAttività di consulenza per individuare e per implementare le azioni correttive da apportare alla gestione aziendale.\nL’attività si svolgerà mediante visite aziendali di 2 ore di consulenza ciascuna e saranno impiegate check list di controllo\";i:2;s:255:\"Attività di consulenza per monitorare la gestione aziendale con le modifiche intraprese. \nL’attività si svolgerà mediante visite aziendali di 2 ore di consulenza ciascuna con l’impiego di check list di controllo e mediante consulenza in back office\";i:3;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:2:{i:0;s:195:\"individuare le effettive esigenze per il destinatario finale a volte può essere complesso perché spesso non dispone di sistemi di gestione idonei ad evidenziare le eventuali criticità presenti\";i:1;s:125:\"acquisire la piena fiducia professionale del destinatario finale per poter far emergere chiaramente le criticità di gestione\";}','Mediante l’esperienza del consulente rappresentata dalla propria conoscenza tecnico/scientifica della materia di competenza, dall’utilizzo degli strumenti informatici ed anche dalla capacità di comunicare con l’interlocutore, sarà possibile far comprendere al destinatario finale i vantaggi derivati da una idonea gestione amministrativa, finanziaria e del personale.',NULL,NULL,2),('3. Investimenti e competitività d) B',34,22,'Il servizio di consulenza proposto, è finalizzato ad accompagnare il destinatario finale nel percorso di certificazione scelto.','3. Investimenti e competitività  d) Supporto alla certificazione Bio, DOP ecc. - B','a:4:{i:0;s:64:\"Check-up aziendale e programmazione della consulenza da svolgere\";i:1;s:391:\"Attività di consulenza per verificare la gestione tecnico-amministrativa e per evidenziare le criticità su cui prevedere le azioni correttive.\nAttività di consulenza per individuare e per implementare le azioni correttive da apportare alla gestione aziendale.\nL’attività si svolgerà mediante visite aziendali di 2 ore di consulenza ciascuna e saranno impiegate check list di controllo\";i:2;s:316:\"Attività di consulenza per monitorare la gestione aziendale e conferire il necessario supporto per le attività richieste dal disciplinare specifico. \nL’attività si svolgerà mediante visite aziendali di 2 ore di consulenza ciascuna con l’impiego di check list di controllo e mediante consulenza in back office\";i:3;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:2:{i:0;s:195:\"individuare le effettive esigenze per il destinatario finale a volte può essere complesso perché spesso non dispone di sistemi di gestione idonei ad evidenziare le eventuali criticità presenti\";i:1;s:125:\"acquisire la piena fiducia professionale del destinatario finale per poter far emergere chiaramente le criticità di gestione\";}','Mediante l’esperienza del consulente rappresentata dalla propria conoscenza tecnico/scientifica della materia di competenza, dall’utilizzo degli strumenti informatici ed anche dalla capacità di comunicare con l’interlocutore, sarà possibile far rispettare al destinatario finale, tutti i requisiti previsti dal disciplinare in esame.',NULL,NULL,2),('4. Direttiva acque a) A',14,9,'Il servizio di consulenza proposto è finalizzato all’individuazione, per ogni destinatario finale che ne usufruirà, degli obblighi: 1) derivanti dall’applicazione dei criteri di utilizzo dei fertilizzati e dei prodotti fisiatrici per la salvaguardia delle acque, nello specifico saranno avviati percorsi di sensibilizzazione con l’avvio di strategie di gestione finalizzate all’innovazione del processo produttivo volte all’utilizzo adeguato e misurate delle sostanze chimiche in agricoltura al fine di ridurre l’inquinamento del suolo e delle acque; 2) La corretta gestione della risorsa idrica sia essa sotterrane che superficiale per finalità irrigue nel pieno rispetto dei piani territoriali di gestione di distretto; 3) corretta gestione degli effluenti oggetto di spandimento.','4. Direttiva acque a) Normativa sulla gestione risorse idriche, tutela delle acque dall’inquinamento, utilizzazione di effluenti e di acque reflue, utilizzo fertilizzanti e prodotti fitosanitari per la salvaguardia delle acque ad uso idropotabile - A','a:4:{i:0;s:64:\"Check-up aziendale e programmazione della consulenza da svolgere\";i:1;s:384:\"Attività di analisi e valutazione delle competenze in materia del destinatario dell’attività con sopralluoghi e verifica della situazione aziendale in ordine alle tematiche da affrontare, con analisi, valutazione e soluzione delle criticità rilevate.\nL’attività si svolgerà mediante visite aziendali di 2 ore di consulenza ciascuna e saranno impiegate check list di controllo\";i:2;s:435:\"Attività di consulenza per l’attuazione di soluzioni correttive o di miglioramento del processo di produzione aziendale di gestione delle coltivazioni al fine di ridurre la contaminazione delle acque, ivi compresa la corretta gestione dello spandimento degli effluenti di allevamento\nL’attività si svolgerà mediante la verifica di check list di controllo e l’elaborazione della documentazione tecnica che si è resa necessaria\";i:3;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:3:{i:0;s:261:\"individuare gli obblighi aziendali per il destinatario finale relativamente alla corretta gestione della risorsa idrica, la corretta utilizzazione degli effluenti oggetto di spandimento, adeguato e corretto utilizzo dei prodotti fitosanitari e dei fertilizzanti\";i:1;s:198:\"miglioramento dei protocolli di processo produttivo finalizzati alla salvaguardia delle acque compatibili con la realtà aziendale del destinatario finale oltreché essere economicamente sostenibili\";i:2;s:92:\"sensibilizzare il destinatario finale nei confronti delle più complesse norme da rispettare\";}','Mediante l’esperienza del consulente rappresentata dalla propria conoscenza tecnico/scientifica della materia di competenza, dall’utilizzo degli strumenti informatici ed anche dalla capacità di comunicare con l’interlocutore, sarà possibile far comprendere al destinatario finale sia gli obblighi aziendali nei confronti delle tematiche in parola che i necessari interventi migliorativi al fine di ottenere il pieno rispetto delle normative di riferimento, con un miglioramento della qualità delle produzioni ed un risparmio economico auspicabile derivante dall’applicazione di protocolli produttivi efficienti quanto efficaci.',NULL,NULL,2),('4. Direttiva acque b) B',34,22,'Il servizio di consulenza proposto per ogni destinatario finale che ne usufruirà è finalizzato al miglioramento dell’efficienza irrigua alle coltivazioni con riduzione dei costi di esercizio e risparmio della risorsa idrica mediante:\n1) valutazione ed applicazione degli obblighi derivanti dall’applicazione dei criteri di utilizzo della risorsa idrica;\n2) consulenza per l’introduzione di nuovi sistemi di irrigazione a minor consumo della risorsa con il passaggio dall’irrigazione a pioggia quella localizzata mediante manichetta sia a suolo che interrata ad alta efficienza irrigua;\n3) Consulenza per l’introduzione di sistemi di telecontrollo dei sistemi di irrigazione;\n4) Consulenza per l’introduzione di sistemi irrigui non di superficie ma suddivisi in settori al fine di diversificare gli apporti idrici secondo le reali necessità delle coltivazioni in considerazione della diversità di suolo (granulometria, tessitura giacitura);','4. Direttiva acque b) Tecniche innovative di irrigazione, gestione risorse finalizzate al risparmio idrico, gestione degli invasi aziendali - B','a:4:{i:0;s:64:\"Check-up aziendale e programmazione della consulenza da svolgere\";i:1;s:384:\"Attività di analisi e valutazione delle competenze in materia del destinatario dell’attività con sopralluoghi e verifica della situazione aziendale in ordine alle tematiche da affrontare, con analisi, valutazione e soluzione delle criticità rilevate.\nL’attività si svolgerà mediante visite aziendali di 2 ore di consulenza ciascuna e saranno impiegate check list di controllo\";i:2;s:428:\"Attività di consulenza per l’attuazione di soluzioni correttive o di miglioramento del processo irriguo inteso come introduzione di nuove tecniche di irrigazione finalizzate al risparmio della risorsa idrica ed all’ottimizzazione dell’efficienza irrigua alle coltivazioni.\nL’attività si svolgerà mediante la verifica di check list di controllo e l’elaborazione della documentazione tecnica che si è resa necessaria\";i:3;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:5:{i:0;s:51:\"migliorare l’efficienza irrigua alle coltivazioni\";i:1;s:43:\"ridurre i costi di esercizio degli impianti\";i:2;s:36:\"ridurre il consumo di risorsa idrica\";i:3;s:92:\"sensibilizzare il destinatario finale nei confronti delle più complesse norme da rispettare\";i:4;s:59:\"la sensibilizzazione ed il rispetto delle direttive Habitat\";}','Miglioramento delle competenze specifiche del destinatario finale sulla tematica dell’irrigazione, al fine di ottimizzare l’attività irrigua aziendale finalizzata al miglioramento della qualità delle produzioni con riduzione dei costi di esercizio e della risorsa idrica impiegata.',NULL,NULL,2),('4. Direttiva acque c) B',34,22,'Il servizio di consulenza proposto per ogni destinatario finale che ne usufruirà è finalizzato alla corretta applicazione delle norme contenute nella direttiva nitrati ed al consono utilizzo dei fertilizzanti ed affluenti di allevamento secondo necessità di quantità adeguate alle coltivazioni e nella corretta temporalità di distribuzione.\n La consulenza ha la finalità di sensibilizzare ed istruire il destinatario finale che la fertilizzazione è un intervento per il quale bisogna prestare particolarmente attenzione sia in ordine all’efficienza attesa dalla concimazione sia per le normative che regolano le modalità di esecuzione delle operazioni, il tutto finalizzato alla riduzione degli apporti di concime, mediante la distribuzione dello stesso nelle giuste quantità necessarie al raggiungimento delle produzioni attese.','4. Direttiva acque c) Piani di Concimazione e piani di utilizzazione agronomica -B','a:4:{i:0;s:64:\"Check-up aziendale e programmazione della consulenza da svolgere\";i:1;s:801:\"Attività di analisi e valutazione delle competenze in materia del destinatario dell’attività con sopralluoghi e verifica della situazione aziendale in ordine alle tematiche da affrontare, con analisi, valutazione delle modalità di esecuzione degli interventi di concimazione e modalità di esecuzione.\nSensibilizzazione sulla tematica relativa alle diverse necessità di concimazione tra tipo di coltivazione e tipo di produzioni da ottenere, valutazione della situazione della dotazione dei suoli di nutrienti con introduzione di azioni correttive finalizzate a ottenere l’apporto di macro e micro elementi in quantità adeguata alle necessità della coltivazione.\nL’attività si svolgerà mediante visite aziendali di 2 ore di consulenza ciascuna e saranno impiegate check list di controllo\";i:2;s:439:\"Attività di consulenza per l’attuazione di soluzioni correttive o di miglioramento nell’esecuzione delle concimazioni e ottimale redazione dei piani di concimazione e PUA relativi allo spandimento degli effluenti di allevamento e digestato da impianti da biomassa.\n  alle coltivazioni.\nL’attività si svolgerà mediante la verifica di check list di controllo e l’elaborazione della documentazione tecnica che si è resa necessaria\";i:3;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:6:{i:0;s:108:\"la corretta ed adeguata somministrazione degli elementi nutritivi necessari allo sviluppo delle coltivazioni\";i:1;s:43:\"ridurre i costi per l’acquisto di concimi\";i:2;s:105:\"migliorare la temporalità nella distribuzione degli elementi nutritivi nei periodi di massima efficienza\";i:3;s:49:\"ridurre la dispersione dei nitrati nel sottosuolo\";i:4;s:141:\"necessità di programmare le concimazioni mediante specifici strumenti al fine della determinazione delle quantità adeguate da somministrare\";i:5;s:59:\"la sensibilizzazione ed il rispetto della direttiva nitrati\";}','Miglioramento delle competenze specifiche del destinatario finale sulla tematica della concimazione, al fine di trovare la massima efficienza dell’intervento con riduzione della somministrazione.',NULL,NULL,2),('5. Difesa integrata e biologica a) A',14,10,'Il servizio di consulenza proposto per ogni destinatario finale che ne usufruirà, è finalizzato alla corretta informazione sulle norme vigenti in materia di uso sostenibile e loro applicazione.\nLa consulenza ha la finalità di sensibilizzare il destinatario finale circa i rischi e gli impatti dei prodotti fitosanitari sulla salute umana, sull’ambiente e sulla biodiversità.','5. Uso prodotti fitosanitari, difesa integrata e biologica a) Normativa sull’uso sostenibile dei prodotti fitosanitari - A','a:4:{i:0;s:64:\"Check-up aziendale e programmazione della consulenza da svolgere\";i:1;s:352:\"Attività di analisi e valutazione delle competenze in materia del destinatario dell’attività mediante incontri dedicati nelle quali verranno date le nozioni generali sulla normativa vigente e loro corretta applicazione.\nL’attività si svolgerà mediante visite aziendali di 2 ore di consulenza ciascuna e saranno impiegate check list di controllo\";i:2;s:422:\"Attività di valutazione nell’applicazione pratica delle norme in azienda con indicazioni delle azioni correttive, valutazione del parco attrezzi per la distribuzione prodotti fitosanitari e loro rispondenza alle norme ivi compreso la corretta utilizzazione degli stessi.\nL’attività si svolgerà mediante la verifica di check list di controllo e l’elaborazione della documentazione tecnica che si è resa necessaria\";i:3;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:5:{i:0;s:123:\"la riduzione dei rischi e degli impatti dei prodotti fitosanitari sulla salute umana, sull’ambiente e sulla biodiversità\";i:1;s:118:\"la promozione dell’applicazione della difesa integrata, dell’agricoltura biologica e di altri approcci alternativi\";i:2;s:25:\"la tutela dei consumatori\";i:3;s:31:\"la salvaguardia dell’ambiente\";i:4;s:36:\"la conservazione della biodiversità\";}','Miglioramento delle competenze specifiche del destinatario finale sulla tematica dell’uso sostenibile dei prodotti fitosanitari, al fine della piena presa di coscienza della tematica e sua applicazione.',NULL,NULL,2),('5. Difesa integrata e biologica b) B',34,22,'Il servizio di consulenza proposto per ogni destinatario finale che ne usufruirà è finalizzato rendere la corretta conoscenza delle tecniche di utilizzo dei prodotti fitosanitari, con l’intento di avviare o assistere il destinatario finale nell’uso corretto dei prodotti al fine di mitigare gli effetti negativi sull’ambiente e sulla salute umana.','5. Uso prodotti fitosanitari, difesa integrata e biologica b) Tecniche per l’impiego ed il controllo dei prodotti fitosanitari e impatti ambientali e sulla salute umana - B','a:4:{i:0;s:64:\"Check-up aziendale e programmazione della consulenza da svolgere\";i:1;s:484:\"Attività di analisi delle competenze in materia del destinatario dell’attività di manipolazione ed impiego dei prodotti fitosanitari mediante sopralluoghi in azienda durante le operazioni di distribuzione dei prodotti con verifica delle modalità di utilizzo degli stessi, con indicazioni delle azioni migliorative/correttive da applicare al processo.\nL’attività si svolgerà mediante visite aziendali di 2 ore di consulenza ciascuna e saranno impiegate check list di controllo\";i:2;s:311:\"Attività di valutazione nell’applicazione delle tecniche di distribuzione dei prodotti con l’istituzione di uno specifico protocollo operativo se necessario.\nL’attività si svolgerà mediante la verifica di check list di controllo e l’elaborazione della documentazione tecnica che si è resa necessaria\";i:3;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:3:{i:0;s:87:\"la corretta ed adeguata formazione degli addetti selle tecniche di impiego dei prodotti\";i:1;s:85:\"la corretta funzionalità delle attrezzature dedicate alla distribuzione dei prodotti\";i:2;s:219:\"la corretta lettura e comprensione delle etichette dei prodotti finalizzata alla corretta utilizzazione ai cui sono finalizzati ed alla diversità di rischio che il prodotto hanno in ragione della tipologia degli stessi\";}','Miglioramento delle competenze specifiche del destinatario finale sulla tematica dell’uso corretto dei prodotti fitosanitari, al fine della piena presa di coscienza della tematica e sua applicazione.',NULL,NULL,2),('5. Difesa integrata e biologica c) B',34,26,'Il servizio di consulenza proposto per ogni destinatario finale che ne usufruirà è finalizzato fornire l’assistenza tecnica sui metodi e corretta applicazione degli stessi in agricoltura biologica e integrata volontaria.','5. Uso prodotti fitosanitari, difesa integrata e biologica c) Strategia di difesa fitosanitaria in agricoltura biologica e integrata -B','a:4:{i:0;s:64:\"Check-up aziendale e programmazione della consulenza da svolgere\";i:1;s:764:\"Attività di assistenza e consulenza in capo al fine di garantire gli interventi fitosanitari alle coltivazioni secondo necessita e secondo metodo agricoltura biologica/integrata volontaria. L’attività presuppone un’assidua presenza in campo al fine di verificare le singole situazioni di necessità delle colture in considerazione dell’andamento stagionale e dell’incidenza dei cicli di sviluppo dei patogeni. Il tutto in collaborazione con il destinatario finale o chi da lui delegato all’esecuzione degli interventi necessari o in eventualità mediante report immediato telefonico degli interventi e strategie da attuare. L’attività si svolgerà mediante visite aziendali di 2 ore di consulenza ciascuna e saranno impiegate check list di controllo\";i:2;s:410:\"Attività di valutazione consisterà nella verifica in campo delle eventuali situazioni fitopatologiche da affrontare con quali mezzi, strumenti prodotti il tutto nella logica della soglia di intervento alla base dei metodi di agricoltura biologica o integrata.\nL’attività si svolgerà mediante la verifica di check list di controllo e l’elaborazione della documentazione tecnica che si è resa necessaria\";i:3;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:5:{i:0;s:50:\"l’esecuzione degli interventi secondo necessità\";i:1;s:127:\"l’utilizzo di prodotti a basso impatto ambientali utilizzando se possibile molecole o metodi di lotta ai patogeni alternativi\";i:2;s:67:\"ottimizzazione degli interventi in agricoltura integrata volontaria\";i:3;s:78:\"miglioramento delle tecniche di utilizzo dei prodotti in agricoltura biologica\";i:4;s:242:\"sviluppo delle attività di lotta biologica dei parassiti mediante lo sviluppo delle confusioni sessuali o con l’utilizzo di prodotti estremamente a basso impatto ambientale che trovano effetti collaterali al contenimento di più avversità\";}','Miglioramento delle competenze specifiche del destinatario finale con riduzione degli interventi fitosanitari sia in agricoltura integrata che biologica al fine di ridurre le emissioni in ambiente e tutelare la biodiversità.',NULL,NULL,2),('6. Sicurezza sul lavoro e dell’azienda a) A',14,8,'Il servizio di consulenza proposto è finalizzato all’individuazione, per ogni destinatario finale che ne usufruirà, degli obblighi derivanti dall’applicazione delle disposizioni di cui al d.lgs. n° 81/08 e s.m.i. “Attuazione dell\'articolo 1 della legge 3 agosto 2007, n. 123, in materia di tutela della salute e della sicurezza nei luoghi di lavoro” (testo unico sulla salute e sicurezza sul lavoro pubblicato nella Gazzetta Ufficiale n. 101 del 30 aprile 2008 - Suppl. Ordinario n.108) il quale dispone il rispetto e l’osservanza delle misure generali per la protezione della salute e per la sicurezza dei lavoratori indicate dall\'Art. 15 e pone a carico del Datore di Lavoro, in relazione alla natura dell\'attività dell\'Azienda, la valutazione dei rischi per la sicurezza e la salute dei lavoratori, Art. 17.','6. Sicurezza sul lavoro e dell’azienda a) Obblighi derivanti dalla normativa vigente - A','a:4:{i:0;s:64:\"Check-up aziendale e programmazione della consulenza da svolgere\";i:1;s:461:\"Attività di consulenza per la verifica del rispetto degli obblighi derivanti dall’applicazione delle disposizioni di cui al d.lgs. n° 81/08 e s.m.i. “Attuazione dell\'articolo 1 della legge 3 agosto 2007, n. 123, in materia di tutela della salute e della sicurezza nei luoghi di lavoro.” riconducibili al destinatario finale. L’attività si svolgerà mediante visite aziendali di 2 ore di consulenza ciascuna e saranno impiegate check list di controllo\";i:2;s:481:\"Attività di consulenza per la verifica del rispetto degli obblighi derivanti dall’applicazione delle disposizioni di cui al d.lgs. n° 81/08 e s.m.i. “Attuazione dell\'articolo 1 della legge 3 agosto 2007, n. 123, in materia di tutela della salute e della sicurezza nei luoghi di lavoro.” riconducibili al destinatario finale. L’attività si svolgerà mediante la verifica di check list di controllo e l’elaborazione della documentazione tecnica che si è resa necessaria\";i:3;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:2:{i:0;s:486:\"individuare gli obblighi aziendali per il destinatario finale relativamente al mantenimento della conformità legislativa riguardo l’applicazione delle disposizioni di cui al d.lgs. n° 81/08 e s.m.i. “Attuazione dell\'articolo 1 della legge 3 agosto 2007, n. 123, in materia di tutela della salute e della sicurezza nei luoghi di lavoro” e contestualmente rendere tali azioni compatibili con la realtà aziendale del destinatario finale oltreché essere economicamente sostenibili\";i:1;s:92:\"sensibilizzare il destinatario finale nei confronti delle più complesse norme da rispettare\";}','Mediante l’esperienza del consulente, rappresentata dalla propria conoscenza tecnico/scientifica della materia di competenza, dall’utilizzo degli strumenti informatici ed anche dalla capacità di comunicare con l’interlocutore, sarà possibile far comprendere al destinatario finale sia gli obblighi aziendali nei confronti delle disposizioni di cui al d.lgs. n° 81/08 e s.m.i. “Attuazione dell\'articolo 1 della legge 3 agosto 2007, n. 123, in materia di tutela della salute e della sicurezza nei luoghi di lavoro”, che i necessari interventi da apportare nella propria azienda per rispettare la normativa.',NULL,NULL,2),('6. Sicurezza sul lavoro e dell’azienda b) B',34,22,'Il servizio di consulenza proposto è finalizzato alla redazione, per ogni destinatario finale che ne usufruirà, dei protocolli di valutazione dei rischi in azienda ad all’impostazione degli adempimenti obbligatori derivanti dall’applicazione delle disposizioni di cui al d.lgs. n° 81/08 e s.m.i. “Attuazione dell\'articolo 1 della legge 3 agosto 2007, n. 123, in materia di tutela della salute e della sicurezza nei luoghi di lavoro” (testo unico sulla salute e sicurezza sul lavoro pubblicato nella Gazzetta Ufficiale n. 101 del 30 aprile 2008 - Suppl. Ordinario n.108) il quale dispone il rispetto e l’osservanza delle misure generali per la protezione della salute e per la sicurezza dei lavoratori indicate dall\'Art. 15 e pone a carico del Datore di Lavoro, in relazione alla natura dell\'attività dell\'Azienda, la valutazione dei rischi per la sicurezza e la salute dei lavoratori, Art. 17.','6. Sicurezza sul lavoro e dell’azienda b) Protocolli di valutazione dei rischi in azienda e impostazione degli adempimenti obbligatori - B','a:4:{i:0;s:64:\"Check-up aziendale e programmazione della consulenza da svolgere\";i:1;s:670:\"Attività di consulenza per verificare i criteri generali e specifici di individuazione dei pericoli e valutazione dei rischi, con la relativa prioritizzazione degli interventi a corredo.\nAttività di consulenza per l’individuazione delle misure di prevenzione e protezione per la gestione dei rischi significativi, comprensiva di valutazioni sull’adeguatezza dei dispositivi di protezione individuale e sui piani di formazione e informazione dei lavoratori, redazione di procedure per la gestione e verifica delle attività predisposte.\nL’attività si svolgerà mediante visite aziendali di 2 ore di consulenza ciascuna e saranno impiegate check list di controllo\";i:2;s:411:\"Predisposizione di check list specifiche per la realizzazione degli audit. Attività di audit per la verifica del rispetto dei disposti delle procedure redatte e dello stato d’avanzamento dei piani di miglioramento.\nVerbalizzazione degli audit.\nL’attività si svolgerà mediante visite aziendali di 2 ore di consulenza ciascuna con l’impiego di check list di controllo e mediante consulenza in back office\";i:3;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:4:{i:0;s:158:\"verificare i criteri generali e specifici di individuazione dei pericoli e valutazione dei rischi, con la relativa prioritizzazione degli interventi a corredo\";i:1;s:244:\"individuare le misure di prevenzione e protezione per la gestione dei rischi significativi, ivi compreso la valutazione sull’adeguatezza dei dispositivi di protezione individuale e sui piani di formazione e informazione dei lavoratori attuati\";i:2;s:216:\"redigere procedure per la gestione e verifica delle attività predisposte e contestualmente rendere tali azioni compatibili con la realtà aziendale del destinatario finale oltreché essere economicamente sostenibili\";i:3;s:92:\"sensibilizzare il destinatario finale nei confronti delle più complesse norme da rispettare\";}','Mediante l’esperienza del consulente, rappresentata dalla propria conoscenza tecnico/scientifica della materia di competenza, dall’utilizzo degli strumenti informatici ed anche dalla capacità di comunicare con l’interlocutore, sarà possibile redigere funzionali protocolli di valutazione dei rischi, impostare una corretta e specifica gestione degli adempimenti obbligatori e verificare il rispetto dei disposti delle procedure redatte e dei piani di miglioramento di cui al d.lgs. n° 81/08 e s.m.i. “Attuazione dell\'articolo 1 della legge 3 agosto 2007, n. 123, in materia di tutela della salute e della sicurezza nei luoghi di lavoro”.',NULL,NULL,2),('7. Primo insediamento a) B',34,20,'Il servizio di consulenza proposto è finalizzato nel dare supporto, al giovane agricoltore oggetto di nuovo insediamento, per la redazione e attuazione del Piano di Sviluppo Aziendale così come definito e richiesto dal bando della Sottomisura 6.1 del PSR 2014/2020.','7. Primo insediamento a) Supporto alla redazione del piano di sviluppo aziendale - B','a:4:{i:0;s:64:\"Check-up aziendale e programmazione della consulenza da svolgere\";i:1;s:255:\"Attività di consulenza per la definizione del progetto di impresa e la conseguente redazione del Piano di Sviluppo Aziendale. L’attività si svolgerà mediante visite aziendali di 2 ore di consulenza ciascuna e saranno impiegate check list di controllo\";i:2;s:275:\"Assistenza alla redazione del Piano di Sviluppo Aziendale e redazione della documentazione tecnica prevista da quest’ultimo.\nL’attività si svolgerà mediante la verifica di check list di controllo e l’elaborazione della documentazione tecnica che si è resa necessaria\";i:3;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:2:{i:0;s:130:\"individuare per il destinatario finale, gli elementi di fondamentale importanza per il successo del progetto di impresa prefissato\";i:1;s:120:\"sensibilizzare il destinatario finale nei confronti della vasta normativa riguardante il settore produttivo di interesse\";}','Mediante l’esperienza del consulente rappresentata dalla propria conoscenza tecnico/scientifica della materia di competenza, dall’utilizzo degli strumenti informatici ed anche dalla capacità di comunicare con l’interlocutore, sarà possibile completare la redazione di un Piano di Sviluppo Aziendale e determinare una buona probabilità di successo per la nuova impresa avviata.',NULL,NULL,2),('7. Primo insediamento b) A',14,10,'Il servizio di consulenza proposto è finalizzato all’individuazione, per ogni destinatario finale che ne usufruirà, dei requisiti per ottenere/mantenere la qualifica di Imprenditore agricolo professionale oltreché l’assistenza procedurale per eseguire la relativa iscrizione.','7. Primo insediamento b) Imprenditore agricolo professionale - A','a:4:{i:0;s:64:\"Check-up aziendale e programmazione della consulenza da svolgere\";i:1;s:528:\"Attività di consulenza per l’individuazione, per ogni destinatario finale che ne usufruirà, dei requisiti per ottenere/mantenere la qualifica di Imprenditore agricolo professionale. \nLa consulenza comprenderà l’assistenza procedurale per eseguire l’iscrizione nella sezione specifica per gli IAP dell’anagrafe ARTEA. L’attività si svolgerà mediante visite aziendali di 2 ore di consulenza ciascuna e saranno impiegate check list di controllo. Per l’iscrizione IAP sono previste n. 2 ore di attività back office\";i:2;s:104:\"Attività di consulenza per il monitoraggio dei requisiti e delle procedure precedentemente identificate\";i:3;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:1:{i:0;s:155:\"analizzare approfonditamente la rispondenza delle caratteristiche del destinatario finale ai requisiti previsti per l’imprenditore agricolo professionale\";}','Mediante l’esperienza del consulente rappresentata dalla propria conoscenza della materia di competenza, dall’utilizzo degli strumenti informatici ed anche dalla capacità di comunicare con l’interlocutore, sarà possibile far comprendere al destinatario finale i requisiti previsti dalla normativa in questione.',NULL,NULL,2),('8. Cambiamenti climatici e agrobiodiversità a) A',5,4,'Il servizio di consulenza proposto è finalizzato a fornire ad ogni destinatario finale che ne usufruirà, il necessario supporto per introdurre o mantenere le attività e pratiche aziendali volte alla tutela del materiale genetico di origine vegetale, animale e microbica, avente un valore effettivo o potenziale per l\'alimentazione e per l\'agricoltura. Il servizio di consulenza verrà prestato con particolare riferimento alle “risorse locali”, ossia le risorse genetiche di interesse alimentare ed agrario: a) che sono originarie di uno specifico territorio; b) che, pur essendo di origine alloctona, ma non invasive, sono state introdotte da lungo tempo nell\'attuale territorio di riferimento, naturalizzate e integrate tradizionalmente nella sua agricoltura e nel suo allevamento; c) che, pur essendo originarie di uno specifico territorio, sono attualmente scomparse e conservate in orti botanici, allevamenti ovvero centri di conservazione o di ricerca in altre regioni o Paesi.','8. Mitigazione e adattamento ai cambiamenti climatici e agrobiodiversità  a) Valorizzazione dell’agrobiodiversità animale e vegetale - A','a:3:{i:0;s:94:\"Check-up aziendale, analisi del quadro normativo e programmazione della consulenza da svolgere\";i:1;s:225:\"Attività di consulenza consistente nell’approfondimento e valutazione tecnica sull’opportunità e la necessità della tutela e valorizzazione delle risorse locali e sul conseguente effetto sull’agroambiente e sul clima\";i:2;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:2:{i:0;s:152:\"comprendere l’opportunità e la necessità della tutela e valorizzazione delle risorse locali e il conseguente effetto sull’agroambiente e sul clima\";i:1;s:217:\"sensibilizzare il destinatario finale verso la tutela delle risorse locali d’interesse alimentare ed agrario e sull’attuazione di pratiche agronomiche e di allevamento atte a ridurre gli effetti negativi sul clima\";}','Mediante l’esperienza del consulente rappresentata dalla propria conoscenza tecnico/scientifica della materia di competenza, dall’utilizzo degli strumenti informatici ed anche dalla capacità di comunicare con l’interlocutore, sarà possibile far comprendere al destinatario finale la necessità della tutela e valorizzazione delle risorse locali e il conseguente effetto positivo sull’agroambiente e sul clima.',NULL,NULL,NULL),('8. Cambiamenti climatici e agrobiodiversità b) A',11,6,'Il servizio di consulenza proposto è finalizzato a fornire ad ogni destinatario finale che ne usufruirà il necessario supporto per acquisire conoscenze relative alle agroenergie e energie rinnovabili, oltrechè per introdurre o mantenere in azienda sistemi ecosostenibili di produzione di energia.','8. Mitigazione e adattamento ai cambiamenti climatici e agrobiodiversità  b) Agroenergie e energie rinnovabili: biomasse, solare termico, fotovoltaico, eolico e geotermico - A','a:4:{i:0;s:94:\"Check-up aziendale, analisi del quadro normativo e programmazione della consulenza da svolgere\";i:1;s:142:\"Attività di consulenza consistente nell’approfondimento e valutazione tecnica delle risultanze emerse successivamente al check-up aziendale\";i:2;s:95:\"Attività di consulenza consistente nell’illustrazione e discussione degli elaborati prodotti\";i:3;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:2:{i:0;s:186:\"comprendere l’opportunità e la necessità di utilizzare energia prodotta da fonti rinnovabili sia per i positivi effetti sull’ambiente che per la contrazione dei costi d’esercizio\";i:1;s:80:\"sensibilizzare il destinatario finale al risparmio e all’efficienza energetica\";}','Mediante l’esperienza del consulente, rappresentata dalla propria conoscenza tecnico/scientifica della materia di competenza, dall’utilizzo degli strumenti informatici ed anche dalla capacità di comunicare con l’interlocutore, sarà possibile far comprendere al destinatario finale l’opportunità e la necessità di utilizzare energia prodotta da fonti rinnovabili sia per i positivi effetti sull’ambiente che per la contrazione dei costi d’esercizio.',NULL,NULL,NULL),('8. Cambiamenti climatici e agrobiodiversità c) A',7,4,'La bioeconomia è quell’insieme di attività economiche connesse all’invenzione, sviluppo, produzione e uso di prodotti e processi biologici all’interno di quattro macro-settori: 1) agroalimentare; 2) foreste; 3) bioindustria; 4) bioeconomia marina. L’economia circolare è un sistema economico pianificato per riutilizzare i materiali in successivi cicli produttivi, riducendo al massimo gli sprechi. Il servizio di consulenza proposto è finalizzato a fornire ad ogni destinatario finale che ne usufruirà il necessario supporto per acquisire conoscenze relative alla bioeconomia e all’economia circolare, oltrechè per introdurre, mantenere e monitorare sistemi di gestione e produzione ecosostenibili nelle aziende di produzione vegetale e zootecnica.','8. Mitigazione e adattamento ai cambiamenti climatici e agrobiodiversità c) Bioeconomia e Economia circolare - A','a:4:{i:0;s:94:\"Check-up aziendale, analisi del quadro normativo e programmazione della consulenza da svolgere\";i:1;s:142:\"Attività di consulenza consistente nell’approfondimento e valutazione tecnica delle risultanze emerse successivamente al check-up aziendale\";i:2;s:95:\"Attività di consulenza consistente nell’illustrazione e discussione degli elaborati prodotti\";i:3;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:3:{i:0;s:345:\"migliorare la produzione sostenibile e di qualità dei prodotti in ciascuno dei settori (da quelli di produzione primaria a quelli di trasformazione), sfruttando in modo più efficiente le interconnessioni fra gli stessi, con una valorizzazione puntuale della biodiversità sia terrestre che marina, dei servizi ecosistemici e della circolarità\";i:1;s:161:\"creare nuove catene del valore, più lunghe e maggiormente radicate nel territorio, che possano consentire la rigenerazione di aree abbandonate e terre marginali\";i:2;s:62:\"sensibilizzare il destinatario finale al “riuso e riciclo”\";}','Mediante l’esperienza del consulente, rappresentata dalla propria conoscenza tecnico/scientifica della materia di competenza, dall’utilizzo degli strumenti informatici ed anche dalla capacità di comunicare con l’interlocutore, sarà possibile far comprendere al destinatario finale l’opportunità e la necessità di una transizione verso l’economia circolare, integrando la bioeconomia e i modelli di economia circolare, all’interno di una visione in cui la produzione e l’uso di biorisorse rinnovabili, oltre che la loro conversione in prodotti ad alto valore aggiunto, faccia parte di un sistema circolare che renda le attività economiche più redditizie e sostenibili nel lungo periodo.',NULL,NULL,NULL),('9. Zootecnica a) A',14,10,'Il servizio di consulenza proposto è finalizzato all’individuazione, per ogni destinatario finale che ne usufruirà, degli obblighi derivanti dall’applicazione dei criteri di gestione obbligatori (CGO), e delle norme per il mantenimento del terreno in buone condizioni agronomiche e ambientali (BCAA). Gestione ecosostenibile dell’allevamento. Misure di biosicurezza e protezione degli animali negli allevamenti. Il servizio di base è dedicato ai destinatari finali con esigenze aziendali poco complesse.','9. Zootecnica- a) OBBLIGHI DERIVANTI DALLA NORMATIVA SULLA CONDIZIONALITA’E SULLA SICUREZZA ALIMENTARE, PRATICHE E TECNICHE DELL’AZIENDA SOSTENIBILI PER L’AMBIENTE E RISPONDENTI AI CAMBIAMENTI CLIMATICI, PREVENZIONE DEGLI ATTACCHI DI PREDATORI - A','a:5:{i:0;s:64:\"Check-up aziendale e programmazione della consulenza da svolgere\";i:1;s:419:\"Attività di consulenza per verificare il rispetto dei criteri di gestione obbligatori (CGO) e delle norme per il mantenimento del terreno in buone condizioni agronomiche e ambientali (BCAA), l’applicazione di misure di Biosicurezza ed Ecosostenibilità nella gestione dell’allevamento. L’attività si svolgerà mediante visite aziendali di 2 ore di consulenza ciascuna e saranno impiegate check list di controllo\";i:2;s:271:\"Attività di consulenza per la valutazione delle non conformità riscontrate. Redazione di un piano di rientro delle non conformità e messa a punto di procedure e protocolli operativi da consegnare all’azienda quale ausilio di rientro dalle non conformità riscontrate\";i:3;s:265:\"Visite di consulenza in azienda per verificare il rientro delle non conformità riscontrate nelle visite precedenti. L’attività si svolgerà mediante la verifica di check list di controllo e l’elaborazione della documentazione tecnica che si è resa necessaria\";i:4;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:2:{i:0;s:471:\"individuare gli obblighi aziendali per il destinatario finale relativamente al mantenimento del rispetto dei criteri di gestione obbligatori (CGO) e (BCAA), rendere consapevole l’allevatore dell’importanza dell’applicazione delle misure di biosicurezza e protezione degli animali e di tecniche di allevamento ecosostenibili, contestualmente rendere tali azioni compatibili con la realtà aziendale del destinatario finale oltreché essere economicamente sostenibili\";i:1;s:92:\"sensibilizzare il destinatario finale nei confronti delle più complesse norme da rispettare\";}','Mediante l’esperienza del consulente rappresentata dalla propria conoscenza tecnico/scientifica della materia di competenza, dall’utilizzo degli strumenti informatici ed anche dalla capacità di comunicare con l’interlocutore, sarà possibile far comprendere al destinatario finale  gli obblighi aziendali nei confronti delle CGO, BCAA e migliorare l’efficienza e la sostenibilità dell’allevamento adottando misure di biosicurezza e tecniche di allevamento ecosostenibili e i necessari interventi da apportare nella propria azienda per rispettare le normative.',NULL,NULL,2),('9. Zootecnica a) B',34,24,'Il servizio di consulenza proposto è finalizzato all’individuazione, per ogni destinatario finale che ne usufruirà, degli obblighi derivanti dall’applicazione dei criteri di gestione obbligatori (CGO), e delle norme per il mantenimento del terreno in buone condizioni agronomiche e ambientali (BCAA). Gestione ecosostenibile dell’allevamento. Misure di biosicurezza e protezione degli animali negli allevamenti.','9. Zootecnica- a) OBBLIGHI DERIVANTI DALLA NORMATIVA SULLA CONDIZIONALITA’E SULLA SICUREZZA ALIMENTARE, PRATICHE E TECNICHE DELL’AZIENDA SOSTENIBILI PER L’AMBIENTE E RISPONDENTI AI CAMBIAMENTI CLIMATICI, PREVENZIONE DEGLI ATTACCHI DI PREDATORI - B','a:5:{i:0;s:64:\"Check-up aziendale e programmazione della consulenza da svolgere\";i:1;s:419:\"Attività di consulenza per verificare il rispetto dei criteri di gestione obbligatori (CGO) e delle norme per il mantenimento del terreno in buone condizioni agronomiche e ambientali (BCAA), l’applicazione di misure di Biosicurezza ed Ecosostenibilità nella gestione dell’allevamento. L’attività si svolgerà mediante visite aziendali di 2 ore di consulenza ciascuna e saranno impiegate check list di controllo\";i:2;s:271:\"Attività di consulenza per la valutazione delle non conformità riscontrate. Redazione di un piano di rientro delle non conformità e messa a punto di procedure e protocolli operativi da consegnare all’azienda quale ausilio di rientro dalle non conformità riscontrate\";i:3;s:265:\"Visite di consulenza in azienda per verificare il rientro delle non conformità riscontrate nelle visite precedenti. L’attività si svolgerà mediante la verifica di check list di controllo e l’elaborazione della documentazione tecnica che si è resa necessaria\";i:4;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:2:{i:0;s:471:\"individuare gli obblighi aziendali per il destinatario finale relativamente al mantenimento del rispetto dei criteri di gestione obbligatori (CGO) e (BCAA), rendere consapevole l’allevatore dell’importanza dell’applicazione delle misure di biosicurezza e protezione degli animali e di tecniche di allevamento ecosostenibili, contestualmente rendere tali azioni compatibili con la realtà aziendale del destinatario finale oltreché essere economicamente sostenibili\";i:1;s:92:\"sensibilizzare il destinatario finale nei confronti delle più complesse norme da rispettare\";}','Mediante l’esperienza del consulente rappresentata dalla propria conoscenza tecnico/scientifica della materia di competenza, dall’utilizzo degli strumenti informatici ed anche dalla capacità di comunicare con l’interlocutore, sarà possibile far comprendere al destinatario finale  gli obblighi aziendali nei confronti delle CGO, BCAA e migliorare l’efficienza e la sostenibilità dell’allevamento adottando misure di biosicurezza e tecniche di allevamento ecosostenibili e i necessari interventi da apportare nella propria azienda per rispettare le normative.',NULL,NULL,2),('9. Zootecnica b) A',14,10,'Il servizio di consulenza proposto è finalizzato a migliorare la produttività aziendale mediante la verifica dei seguenti aspetti:\n1. l’efficienza dell’organizzazione e gestione aziendale, dimensionamento e organizzazione degli spazi delle stalle necessari a garantire il benessere degli animali;\n2. la qualità delle produzioni foraggere, gestione del pascolamento, conservazione e somministrazione degli alimenti, razionamento. La qualità e lo stoccaggio degli alimenti aziendali sono determinanti per la salute e la produttività degli animali e per la qualità e sicurezza dei prodotti ottenuti;  \n3. le tecniche di riproduzione più idonee alla razza, al sistema di allevamento, al tipo di produzioni aziendali, al miglioramento genetico;\n4. il livello di igiene e sanità dell’allevamento, le condizioni di benessere degli animali per favorire produzioni di qualità e resistenza alle malattie.','9. Zootecnica- b) MIGLIORAMENTO TECNICO ECONOMICO DELL’AZIENDA: TECNICHE DI ALLEVAMENTO, GESTIONE DELLE RISORSE FORAGGERE E DELLA FASE DI ALIMENTAZIONE, BENESSERE ANIMALE, PROFILI SANITARI E MIGLIORAMENTO DELLA RIPRODUZIONE ANIMALE, QUALITA’ E VALORIZZAZIONI DELLE PRODUZIONI - A','a:5:{i:0;s:64:\"Check-up aziendale e programmazione della consulenza da svolgere\";i:1;s:632:\"Attività di consulenza per verificare l’organizzazione e la gestione aziendale, dimensionamento delle stalle rispetto al numero di animali, gestione degli spazi, manutenzione dei ricoveri e delle superfici circostanti. \nAttività di consulenza per valutare il valore nutritivo e la sicurezza delle produzioni aziendali (fieni, cereali, pascoli) utilizzate nel razionamento dell’allevamento. \nAttività di consulenza per verificare lo stato igienico sanitario dell’allevamento e delle produzioni.\n L’attività si svolgerà mediante visite aziendali di 2 ore di consulenza ciascuna e saranno impiegate check list di controllo\";i:2;s:271:\"Attività di consulenza per la valutazione delle non conformità riscontrate. Redazione di un piano di rientro delle non conformità e messa a punto di procedure e protocolli operativi da consegnare all’azienda quale ausilio di rientro dalle non conformità riscontrate\";i:3;s:265:\"Visite di consulenza in azienda per verificare il rientro delle non conformità riscontrate nelle visite precedenti. L’attività si svolgerà mediante la verifica di check list di controllo e l’elaborazione della documentazione tecnica che si è resa necessaria\";i:4;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:4:{i:0;s:111:\"necessità di apportare cambiamenti per migliorare la produttività dell’azienda e il benessere degli animali\";i:1;s:201:\"migliorare l\'alimentazione e il razionamento partendo dalla valorizzazione delle produzioni aziendali esistenti migliorando le tecniche e i tempi di fienagione, le modalità di stoccaggio e di utilizzo\";i:2;s:150:\"gestione delle problematiche sanitarie e individuazione dei protocolli terapeutici e gestionali per il controllo, la cura e il benessere degli animali\";i:3;s:123:\"sensibilizzare il destinatario finale nei confronti delle più complesse innovazioni gestionali e tecnologiche da apportare\";}','Mediante l’esperienza del consulente rappresentata dalla propria conoscenza tecnico/scientifica della materia di competenza, dall’utilizzo degli strumenti informatici ed anche dalla capacità di comunicare con l’interlocutore, sarà possibile far comprendere al destinatario finale l’importanza basilare della cura e del benessere animale che sarà garantito fornendo ricoveri con spazi ampi, aerati e confortevoli, un’alimentazione sana, equilibrata e sufficiente per le produzioni, evitando per quanto possibile ogni genere di stress e predisponendo un protocollo di profilassi diretta e indiretta per il controllo delle patologie ricorrenti. Tutto questo sarà il presupposto per migliorare la fertilità e salute dell’allevamento e  la qualità e quantità delle produzioni aziendali.',NULL,NULL,2),('9. Zootecnica b) B',34,24,'Il servizio di consulenza proposto è finalizzato a migliorare la produttività aziendale mediante la verifica dei seguenti aspetti:\n1. l’efficienza dell’organizzazione e gestione aziendale, dimensionamento e organizzazione degli spazi delle stalle necessari a garantire il benessere degli animali;\n2. la qualità delle produzioni foraggere, gestione del pascolamento, conservazione e somministrazione degli alimenti, razionamento. La qualità e lo stoccaggio degli alimenti aziendali sono determinanti per la salute e la produttività degli animali e per la qualità e sicurezza dei prodotti ottenuti;  \n3. le tecniche di riproduzione più idonee alla razza, al sistema di allevamento, al tipo di produzioni aziendali, al miglioramento genetico;\n4. il livello di igiene e sanità dell’allevamento, le condizioni di benessere degli animali per favorire produzioni di qualità e resistenza alle malattie.','9. Zootecnica- b) MIGLIORAMENTO TECNICO ECONOMICO DELL’AZIENDA: TECNICHE DI ALLEVAMENTO, GESTIONE DELLE RISORSE FORAGGERE E DELLA FASE DI ALIMENTAZIONE, BENESSERE ANIMALE, PROFILI SANITARI E MIGLIORAMENTO DELLA RIPRODUZIONE ANIMALE, QUALITA’ E VALORIZZAZIONI DELLE PRODUZIONI - B','a:5:{i:0;s:64:\"Check-up aziendale e programmazione della consulenza da svolgere\";i:1;s:632:\"Attività di consulenza per verificare l’organizzazione e la gestione aziendale, dimensionamento delle stalle rispetto al numero di animali, gestione degli spazi, manutenzione dei ricoveri e delle superfici circostanti. \nAttività di consulenza per valutare il valore nutritivo e la sicurezza delle produzioni aziendali (fieni, cereali, pascoli) utilizzate nel razionamento dell’allevamento. \nAttività di consulenza per verificare lo stato igienico sanitario dell’allevamento e delle produzioni.\n L’attività si svolgerà mediante visite aziendali di 2 ore di consulenza ciascuna e saranno impiegate check list di controllo\";i:2;s:271:\"Attività di consulenza per la valutazione delle non conformità riscontrate. Redazione di un piano di rientro delle non conformità e messa a punto di procedure e protocolli operativi da consegnare all’azienda quale ausilio di rientro dalle non conformità riscontrate\";i:3;s:265:\"Visite di consulenza in azienda per verificare il rientro delle non conformità riscontrate nelle visite precedenti. L’attività si svolgerà mediante la verifica di check list di controllo e l’elaborazione della documentazione tecnica che si è resa necessaria\";i:4;s:88:\"Resoconto consuntivo delle attività intraprese e della situazione finale dell’Azienda\";}','a:4:{i:0;s:111:\"necessità di apportare cambiamenti per migliorare la produttività dell’azienda e il benessere degli animali\";i:1;s:201:\"migliorare l\'alimentazione e il razionamento partendo dalla valorizzazione delle produzioni aziendali esistenti migliorando le tecniche e i tempi di fienagione, le modalità di stoccaggio e di utilizzo\";i:2;s:150:\"gestione delle problematiche sanitarie e individuazione dei protocolli terapeutici e gestionali per il controllo, la cura e il benessere degli animali\";i:3;s:123:\"sensibilizzare il destinatario finale nei confronti delle più complesse innovazioni gestionali e tecnologiche da apportare\";}','Mediante l’esperienza del consulente rappresentata dalla propria conoscenza tecnico/scientifica della materia di competenza, dall’utilizzo degli strumenti informatici ed anche dalla capacità di comunicare con l’interlocutore, sarà possibile far comprendere al destinatario finale l’importanza basilare della cura e del benessere animale che sarà garantito fornendo ricoveri con spazi ampi, aerati e confortevoli, un’alimentazione sana, equilibrata e sufficiente per le produzioni, evitando per quanto possibile ogni genere di stress e predisponendo un protocollo di profilassi diretta e indiretta per il controllo delle patologie ricorrenti. Tutto questo sarà il presupposto per migliorare la fertilità e salute dell’allevamento e  la qualità e quantità delle produzioni aziendali.',NULL,NULL,NULL);
